// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

contract encode {
    function hashsha256() public pure returns(bytes32)
    {
        return sha256(abi.encodePacked("abc","def"));
    }
    function hashsha2561() public pure returns(bytes32)
    {
        return sha256(abi.encodePacked("ab","cdef"));
    }
    function hashsha2562() public pure returns(bytes32)
    {
        return sha256(abi.encodePacked("def","abc"));
    }
}

